import React, { useState, useEffect } from 'react';

function LeadGenerationPage() {
  const [currentPage, setCurrentPage] = useState(1);
  const [pageContent, setPageContent] = useState('');

  // Simülasyon: Sayfa içeriğini admin yapılandırmasına göre getirme
  useEffect(() => {
    // Simülasyon: Admin tarafından yapılandırılmış sayfa içeriği alınır
    const getPageContentFromAdminSettings = (page) => {
      // Sayfa içeriği burada admin yapılandırmasına göre getirilir
      // Örnek: API çağrısı, veritabanı sorgusu, vb.
      return `Sayfa ${page} içeriği...`;
    };

    const content = getPageContentFromAdminSettings(currentPage);
    setPageContent(content);
  }, [currentPage]);

  const handlePrevPage = () => {
    setCurrentPage((prevPage) => prevPage - 1);
  };

  const handleNextPage = () => {
    setCurrentPage((prevPage) => prevPage + 1);
  };

  return (
    <div>
      <h1>Lead Üretme Sayfası</h1>
      <div>
        {/* Sayfa içeriği dinamik olarak render edilir */}
        {pageContent}
      </div>
      <div>
        {/* Geri ve İleri düğmeleri */}
        <button onClick={handlePrevPage} disabled={currentPage === 1}>
          Geri
        </button>
        <button onClick={handleNextPage}>İleri</button>
      </div>
    </div>
  );
}

export default LeadGenerationPage;
